import {BrowserRouter, Route} from "react-router-dom"
import './App.css';
import Home from "./Pages/Home"
import Personality from "./Pages/Personality"
import Aethesticism from "./Pages/Aethesticism"
import Lifestyle from "./Pages/Home"
function App() {
  return (
    <BrowserRouter>
     <div className="App">

      </div>
      <Route path = "/" component={Home}></Route>
      <Route path = "/personality" component={Personality}></Route>
      <Route path = "/aethesticism" component={Aethesticism}></Route>
      <Route path = "/lifestyle" component={Lifestyle}></Route>
    </BrowserRouter>

  );
}

export default App;
